import { Paper, Grid, Box } from "@material-ui/core";

function Postx({ pey, ref, onPostsItemload, post, itemheight }: any) {
  return (
    <>
      <div key={key} className="pics">
        <img
          onLoad={(e: any) => {
            onPostsItemload(e, key);
          }}
          ref={ref}
          className="turlightxx"
          src={`./images/posts/${post.item1}`}
          alt="a superstarz post "
          style={{
            marginTop: pey === 1 ? "0px" : "-29vh",
            width: "100%",
            height: itemheight[key],
            position: "relative",
            zIndex: key + key,
            display: "block",
            padding: "0px",
          }}
        />
        <div
          className="error-background-dark it"
          style={{ zIndex: key + key + key }}
        >
          {" "}
        </div>
      </div>
    </>
  );
}

